import React from 'react';

function Topic({ item, handleClick }) {
  return (
    <button
      onClick={() =>
        handleClick(JSON.parse(item?.topic_contents), item?.fun_links)
      }
      className='flex flex-col px-4 py-4 border border-secondary-grey rounded-lg'
    >
      <div className='w-full h-[160px] bg-secondary-grey rounded-lg'></div>
      <p className='text-sm text-priamry-grey font-medium'>
        {JSON.parse(item?.topic_contents)?.title}
      </p>
    </button>
  );
}

export default Topic;
